description:
Verenigde Staten
Actie / Fantasy
120 minuten

goed

met Ron Perlman, Selma Blair en Luke Goss

Een oud bestand tussen het mensenrijk en een veel ouder ras van mythische wezens staat op het punt verbroken te worden. De 
verbannen prins Nuada wil de mensheid uit de wegruimen om zo plaats te maken voor de wezens die nu in verschuiling moeten leven.
Het is aan Hellboy om Nuada te stoppen voordat hij het allesvernietigende Gouden Leger kan wekken. Samen met een team van het 
Bureau voor Paranormaal Onderzoek en Defensie, met onder meer zijn pyrokinetische vriendin Liz, de aquatische empatholoog Abe 
en de protoplastische mysticus Johann wordt er heen en weer gependeld tussen beide werelden. Uiteindelijk zal Hellboy, een 
schepsel dat in geen van beide werelden echt geaccepteerd wordt, moeten kiezen tussen zijn eigen volk of de mensenwereld waarin 
hij is opgegroeid.
